import Image1 from "../../assets/crud_logo.jpg";
import Image2 from "../../assets/invoice_generator.jpg";
import Image3 from "../../assets/todo_list.png";

export const Data = [
  {
    id: 1,
    image: Image1,
    title: "Crud",
    description:
      "Create, Read, Update, and Delete (CRUD) are the four basic operations of persistent storage. CRUD is also sometimes used to describe user interface conventions that facilitate viewing, searching, and changing information using computer-based forms and reports.",
  },
  {
    id: 2,
    image: Image2,
    title: "Invoice Generator",
    description:
      "Basic frontend application who generate invoice bill with using reactjs technology",
  },
  {
    id: 3,
    image: Image3,
    title: "To-Do List ",
    description:
      "A to-do list is just a list of things you have to-do. That means basically anything and everything can be on your to-do list—but just because you've written your to-dos down doesn't mean your to-do list is actually useful. Effectively tracking when your work is due can help you prioritize and get great work done.",
  },
];
